                quetionType2_ques1: "How to store files?",
                quetionType2_ques1_answ1: 'Mobile App: 1. Upload files: Tap "+" at the right corner of the "Files" tab to upload various types of files to TeraBox. 2. Automatic backup of phone\'s photos and videos: Tap "Personal Center" at the top left corner of TeraBox, select "Auto Backup", and then enable "Photo Auto Backup" and "Video Auto Backup".',
                quetionType2_ques1_answ3: "Please note that currently, filenames uploaded to TeraBox cannot contain special symbols and emojis. If the upload fails due to this, we recommend you to modify the filename locally and try again.",
                quetionType2_ques1_answ2: 'Web/Desktop App: By clicking on "Upload" at the top left corner of the "Files" page, you can upload various types of files.',
                quetionType2_ques2: "How to create a folder?",
                quetionType2_ques2_answ1: 'Mobile App: Tap "+" at the bottom right corner of the "Files" tab. In the pop-up page, select "New Folder" at the bottom left corner. You can then create and name a new folder, and upload the files you want into this folder.',
                quetionType2_ques2_answ2: 'Web/Desktop App: Click on "New Folder" at the top left corner of the "Files" page to create and name a new folder. You can then upload the files you want into this folder.',
                quetionType2_ques3: "File lost",
                quetionType2_ques3_answ1: "TeraBox ensures absolute security of your files' data and privacy",
                quetionType2_ques3_answ2: 'Please ensure the files are stored in the account, as one Google email may correspond to different accounts. On the login page, the account registered via "Log in with Google" and that created by clicking the "Email" and entering "Google Email" are not the same. Please differentiate between them. If you can\'t find the file after logging in through Google, you can try to log in again: On the login page, click "Other Login Methods", select "Email", and then enter your Google email and password to log in.',
                quetionType2_ques3_answ3: 'Please confirm whether the lost file was accidentally deleted. Each file is retained for 10 days for regular users and 30 days for Premium users from the deletion date, and can be retrieved from the "Recycle Bin". If the Recycle Bin is emptied or the retention period expires, the file will be permanently deleted and cannot be recovered.',
                quetionType2_ques4: "File recovery",
                quetionType2_ques4_answ2: 'Web/Desktop App: Click on the "Recycle Bin" at the bottom left of the page to find your deleted files.',
                quetionType2_ques4_answ1: 'Each file is retained for 10 days for regular users and 30 days for Premium users from the deletion date, and can be retrieved from the "Recycle Bin".',
                quetionType2_ques4_answ3: "Please note that if the Recycle Bin is emptied or the retention period expires, the file will be permanently deleted and cannot be recovered.",
