                quetionType3_ques3: "Limit of file upload size",
                quetionType3_ques4: "How to save TeraBox files to local?",
                quetionType3_ques3_answ1: "Mobile/Desktop App: The maximum upload limit per file for non-Premium users is 4GB, while that for Premium is 128GB.",
                quetionType3_ques4_answ1: 'Android/Web/Desktop: Select the target file, click on "Download to Local" / "Download". After the download is completed, you can view it on your local device.',
                quetionType3_ques4_answ2: 'iOS: Select the target file and click on "Export". After the export is completed, you can view it on your local device. Please note that currently, iOS only supports exporting images and videos with the .mov and .mp4 extensions.',
