                quetionType3_ques9_answ2: "2. Verify whether the file complies with local laws. TeraBox strictly prohibits the dissemination of inappropriate information such as pornography, vulgarity, and copyright infringement.",
                quetionType4: "Automatic Backup",
                quetionType4_ques1_answ1: 'Tap "Personal Profile" in the top left corner of the TeraBox App, select "Auto Backup", and enable "Photo Auto Backup" and "Video Auto Backup". Android users can also choose the albums they need to backup. Once automatic backup is enabled, you can back up your local albums anytime, anywhere, without worrying about file loss.',
                quetionType4_ques1: "How to turn on/off automatic backup",
                quetionType4_ques2: "How to backup videos automatically",
                quetionType4_ques2_answ1: 'Non-Premium users can choose to backup videos in compressed quality: Tap "Profile" in the top left corner of the TeraBox App, select "Auto Backup", and enable "Video Auto Backup". At the same time, you can also choose to turn on/off the backup function under non-Wi-Fi conditions.',
                quetionType4_ques2_answ2: "The feature of automatic backup for high-quality videos is currently only available for TeraBox Premium users. You are welcome to subscribe to the Premium in the Personal Center to enjoy more Premium benefits.",
