                quetionType4_ques3: "Are the backed-up photos in their original quality?",
                quetionType4_ques3_answ1: "The photos will be backed up in their original quality without compression, please feel free to backup.",
                quetionType4_ques4_answ1: 'Photos that have been successfully backed up can be viewed in the "Album" tab, and videos that have been successfully backed up can be viewed in the "Video" tab. If you want to check the backup progress, you can click on the transfer [] in the upper right corner of the "Files" tab, and select "Upload List" to view.',
                quetionType5: "Benefits",
                quetionType5_ques2: "Why can't I access/participate in the activity?",
                quetionType5_ques1: "How can I participate in/access the activity",
                quetionType5_ques1_answ1: 'Tap "Personal Center" in the top left corner of the TeraBox App, and then select "Benefits Center" to participate in activities.',
                quetionType5_ques2_answ1: "Some activities are open to only a few users. You have already enjoyed the benefits of this activity and do not need to participate in it. For any questions you might have, please leave a message or write us at activity@terabox.com",
                quetionType5_ques3: "Why did I not receive a reward after accomplishing the task?",
                quetionType5_ques3_answ1: "Rewards are not sent automatically. Please select the Claim button to accept your reward. Once the activity is over, rewards cannot be collected by users who did not participate in the activity or who failed to accept their reward in a timely manner. For any questions you might have, please leave a message or write us at activity@terabox.com",
                quetionType5_ques4_answ1: "To successfully invite a friend, two conditions must be met:",
