                quetionType5_ques6_answ1: "The loading may fail due to network connection. Please try again after ensuring a smooth network connection (and make sure to watch the entire video). You can check whether the reward has been successfully issued in the transaction history of the Gold Center.",
                quetionType6_ques1: "Who is eligible to receive rewards?",
                quetionType6: "Webmaster Center",
                quetionType6_ques1_answ1: "To be eligible to receive rewards:",
                quetionType6_ques1_answ2: "Users who comply with the TeraBox Service Agreement",
                quetionType6_ques1_answ3: "Your TeraBox account has not been suspended or terminated.",
                quetionType6_ques1_answ4: "You and the new user you referred have complied with and will continue to comply with the rules of TeraBox's Webmaster Center.",
                quetionType6_ques2_answ1: "We welcome all users to participate in the TeraBox Referral Program.",
                quetionType6_ques2: "About the TeraBox Referral Program",
                quetionType6_ques2_answ2: 'When new users you referred register an account through your exclusive invitation link, become webmasters, and earn rewards, you can receive a share of their rewards. If they choose the "New User" plan, you will receive 10% of their rewards. If they choose the "Video Play" plan, you will receive 7% of their rewards (excluding any rewards they earn through the webmaster referral program).',
                quetionType6_ques2_answ3: "We may change, suspend, or terminate this program at any time. Any amended rules will apply to all future bonus calculations. If we decide to permanently close the referral program, we will pay all bonuses owed according to these rules within 90 days after the closure.",
                quetionType6_ques2_answ4: "If the bonus is not redeemed within one year of being earned, it will expire.",
                quetionType6_ques3_answ1: "1. Based on the number of new users:",
                quetionType6_ques3: "How does TeraBox calculate rewards?",
                quetionType6_ques3_answ2: "Whenever a new user downloads the TeraBox App and completes registration through the file link you shared, you can receive a bonus. The bonus varies depending on the new users from different countries.",
                quetionType6_ques3_answ4: "USD 0.13: Saudi Arabia, the United Arab Emirates, Portugal, Spain",
