                quetionType6_ques3_answ13: "3. Based on advertising + Premium profit-sharing",
                quetionType6_ques3_answ14: "a. Ad revenue sharing",
                quetionType6_ques3_answ15: "After joining this plan, the new sharing links you generate will include ads, and you can earn money through ad impressions. (Please note links generated before joining this plan will remain unchanged without ads, and cannot contribute effective ad views for this plan)",
                quetionType6_ques3_answ16: "The CPM rates vary by country. Please refer to this table for details.",
                quetionType6_ques3_answ17: "The following circumstances can lead to a decrease in your earnings. Please try to avoid.",
