                quetionType6_ques3_answ20: "Your visitors not reaching the final page",
                quetionType6_ques3_answ21: "b. Premium profit-sharing",
                quetionType6_ques3_answ23: "If a user uses a coupon or other discounts when purchasing Premium, your reward will be reduced. Exchange rate fluctuations will also affect your reward. Please note that your link must be the latest link visited by the user before making a purchase.",
                quetionType6_ques3_answ22: "If a user purchases Premium through your file link, you will receive a 50% reward based on the standard Premium price. (The review period for the Premium plan is 30 days.)",
                quetionType6_ques3_answ24: "If any Premium user referred by you requests a refund at any time after making a purchase, the reward amount will be deducted directly from your balance. You can view the deduction records in your reward history.",
                quetionType6_ques3_answ26: "a. About TeraBox Services",
                quetionType6_ques3_answ25: "3. Based on Paid Content (Testing)",
                quetionType6_ques3_answ29: "TeraBox reserves the right to review the qualifications and content of participants. By joining this program, you agree to authorize TeraBox to distribute your files.",
                quetionType6_ques3_answ27: "TeraBox is a platform that provides users with space for uploading and storing information. It utilizes cloud storage technology to offer users basic online storage and other online services. TeraBox strictly adheres to relevant legal regulations and vigorously combats the dissemination of illegal content or content that infringes upon the legitimate rights of others.",
