                quetionType6_ques3_answ28: "Your use of TeraBox's services implies your acceptance of TeraBox's related agreements, rules, or statements. Please strictly comply with the corresponding requirements. If you engage in illegal activities or infringe upon the legitimate rights of third parties, TeraBox reserves the right to take actions such as disconnecting your links, issuing warnings, suspending your account, withholding your earnings generated on TeraBox, and seeking compensation from you, to ensure the lawful operation of our services.",
                quetionType6_ques3_answ30: "TeraBox reserve the right to update relevant agreements, rules, or issue statements at any time. If you continue to use TeraBox, it will be deemed as your agreement to comply with the rules and requirements we have published. If you disagree, please stop using TeraBox services.",
                quetionType6_ques3_answ34: "After joining this program, TeraBox reserves the rights to price and distribute your content.",
                quetionType6_ques3_answ32: "After joining this plan, you will not be able to switch to others, so please choose carefully. If you need to use other plans, please create a new Webmaster Center account.",
                quetionType6_ques3_answ33: "After users purchase content, TeraBox does not provide any refund options. If users seek refunds from banks or payment processors and if a refund is approved, we will deduct the corresponding amount from your balance.",
                quetionType6_ques3_answ35: "c. Price Setting",
                quetionType6_ques3_answ36: "Currently, you can only set the price for paid content in the Webmaster Center.",
                quetionType6_ques3_answ39: "d. About Transaction Fees",
                quetionType6_ques3_answ37: "Price range: $1 to $100",
                quetionType6_ques3_answ38: "Currency conversion: The amounts you set and the earnings you receive are both settled in USD. The currency of purchasing on a link will be converted into the local currency of the purchaser.",
                quetionType6_ques3_answ40: "As per the payment processor's request, a fixed percentage of fee will be charged for each successful bank card transaction. This fee applies to all bank cards and is entirely collected by the payment processor. Currently, TeraBox does not charge any fees.",
                quetionType6_ques3_answ41: "Due to varying currencies of user payment cards, credit card companies may charge additional foreign exchange fees. Actual earnings are subject to real-time exchange rates and different credit card company policies. Settlement is based on daily exchange rates and estimated earnings are for reference only",
                quetionType6_ques3_answ44: "After the settlement of the amount, there will be a 7-day review period during which the money you have earned will not be temporarily included in your withdrawable balance. Once the review period ends, the money will be available for withdrawal.",
                quetionType6_ques3_answ42: "e. Settlement and Withdrawals",
                quetionType6_ques3_answ43: "We will settle the amount you have earned for the day after 18:00 (GMT+9) the next day.",
                quetionType6_ques3_answ45: "You can find more withdrawal rules under Webmaster Center Rules at the bottom of the Webmaster Center page.",
